message:
⚽️ | A Copa do Mundo 2026 será sediada em três países e contará com 48 seleções

Em 2026, a Copa do Mundo FIFA será sediada, pela primeira vez, por três países: Canadá, Estados Unidos e México. Anteriormente, o torneio apenas foi sediado em mais de um país no mesmo ano em 2002, quando aconteceu no Japão e Coreia do Sul. 

O número de seleções que disputarão também aumentará, de 32 para 48, o que fará com que tenhamos um campeonato mais longo - mais de 35 dias. Com esse aumento, o número de vagas por continente foi modificada, como segue:

- Ásia: 8 (4 a mais em relação à Copa passada);

- África: 9 (4 a mais);

- América Central, do Norte e Caribe: 6 (3 a mais);

- América do Sul: 6 (2 a mais);

- Europa: 16 (3 a mais);

- Oceania: 1 (1 a mais).

Com mais seleções competindo, é esperado um aumento na receita da FIFA.

Via ESPN Brasil | #CopaDoMundo
